import { Outlet, useLocation, useNavigate } from 'react-router-dom'

import './App.css';
import Title from './components/Title';

function App() {
  let navigate = useNavigate()
  const location = useLocation()

  if (!location) {
    navigate('/')
  }

  return (
    <div>
      <Title name={location.state.name} />
      <Outlet />
    </div>
  );
}

export default App;
